import styles from "./Card.module.css";

import cat01Img from "../../img/categories/cat-01.jpg";

const Card = () => {
  return (
    <div className={styles.card}>
      <img className={styles.card__img} src={cat01Img} alt="cat01Img" />
      <div className={styles.card__body}>
        <div className={styles.card__text}>
          <div className={styles.card__title}></div>
          <div className={styles.card__muted}></div>
        </div>
        <div className={styles.card__icon}>ICON</div>
      </div>
    </div>
  );
};

export default Card;
